import React from "react";
import { Routes, Route, BrowserRouter } from "react-router-dom";
import Sales from "./components/Sales";



function App() {
  return (
   <BrowserRouter>
   <div>
     <Routes>
       <Route path="/Sales" element={<Sales/>}/>
     </Routes>
   </div>
   </BrowserRouter>
  );
}

export default App;
